// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

library RaffleHelpers {
    error NoWinners();

    // Equal distribution helper: splits total into n shares, distributing remainder by +1 wei to first rem winners
    function _equalShares(uint256 total, uint256 n) internal pure returns (uint256[] memory shares) {
        if (n == 0) revert NoWinners();
        shares = new uint256[](n);
        uint256 base = total / n;
        uint256 rem = total - (base * n);
        for (uint256 i = 0; i < n; i++) {
            shares[i] = base + (i < rem ? 1 : 0);
        }
    }

    function _selectWinners(address[] memory pool, uint32 k, bytes32 seed) internal pure returns (address[] memory) {
        address[] memory res = new address[](k);
        uint256 n = pool.length;
        for (uint256 i = 0; i < k; i++) {
            uint256 r = uint256(keccak256(abi.encode(seed, i))) % (n - i);
            address tmp = pool[i];
            pool[i] = pool[i + r];
            pool[i + r] = tmp;
            res[i] = pool[i];
        }
        return res;
    }
}

contracts/RaffylFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {ICommunity} from "./interfaces/ICommunity.sol";
import {Community} from "./Community.sol";

interface ITimelockVault {
    function batchPay(
        uint256 raffleId,
        address token,
        address[] calldata tos,
        uint256[] calldata amounts
    ) external;
}

/**
 * @title RaffylFactory
 * @notice Lightweight orchestration per newProposed.md:
 *  - Deploys Community contracts
 *  - Tracks communities and globally lists raffles (by community + id)
 *  - Processes payouts centrally via the community's TimelockVault after timelock expiry
 *  - No per-raffle contracts. Raffles are structs stored inside Community.
 */
contract RaffylFactory {
    address public owner;
    address public treasury;

    // Global registries
    address[] private _communities;
    mapping(address => bool) public isCommunity;
    mapping(address => string) public communityNames;

    struct RaffleRef {
        address community;
        uint256 id;
    }
    RaffleRef[] private _raffles; // global view: (community, raffleId)

    // Uses top-level ITimelockVault interface declared above

    // Events
    event CommunityCreated(address indexed admin, address indexed community, string name);
    event RaffleRegistered(address indexed community, uint256 indexed id);
    event BatchPayoutProcessed(
        address indexed community,
        uint256 indexed id,
        uint256 totalPaid
    );
    event TreasuryChanged(address indexed newTreasury);

    modifier onlyOwner() {
        require(msg.sender == owner, "NOT_OWNER");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setTreasury(address _treasury) external onlyOwner {
        require(_treasury != address(0), "INVALID_ADDRESS");
        treasury = _treasury;
        emit TreasuryChanged(_treasury);
    }

    // Community lifecycle
    // Add name back to creating communities
    function createCommunity(string calldata name) external returns (address community) {
        // Community constructor expects (admin, factory)
        community = address(new Community(msg.sender, address(this)));
        _communities.push(community);
        isCommunity[community] = true;
        communityNames[community] = name;
        emit CommunityCreated(msg.sender, community, name);
    }

    // Views
    function getCommunities() external view returns (address[] memory) {
        return _communities;
    }

    // Global raffles view (parallel arrays for ABI simplicity)
    function getAllRaffles()
        external
        view
        returns (address[] memory communities, uint256[] memory ids)
    {
        uint256 n = _raffles.length;
        communities = new address[](n);
        ids = new uint256[](n);
        for (uint256 i = 0; i < n; i++) {
            communities[i] = _raffles[i].community;
            ids[i] = _raffles[i].id;
        }
    }

    // Called by Community when a raffle is created to index globally
    function onRaffleCreated(uint256 id) external {
        require(isCommunity[msg.sender], "ONLY_COMMUNITY");
        _raffles.push(RaffleRef({community: msg.sender, id: id}));
        emit RaffleRegistered(msg.sender, id);
    }

    // Community requests centralized batch payout; Factory orchestrates via the community's vault
    function processBatchPayout(uint256 id) external {
        require(isCommunity[msg.sender], "ONLY_COMMUNITY");

        // Read winners and amounts from Community
        (address[] memory winners, uint256[] memory amounts) = ICommunity(
            msg.sender
        ).getWinners(id);
        require(winners.length == amounts.length, "LEN_MISMATCH");
        require(winners.length > 0, "NO_WINNERS");

        // Read core raffle to get the token
        (address token, , , , , , , ) = ICommunity(msg.sender).getRaffleCore(id);

        // Access the community vault
        address vaultAddr = ICommunity(msg.sender).vault();
        ITimelockVault vault = ITimelockVault(vaultAddr);

        // Execute batch payout (TimelockVault enforces timelock and totals)
        vault.batchPay(id, token, winners, amounts);

        // The vault marks itself as disbursed internally. Now, mark the raffle as paid out.
        ICommunity(msg.sender).markRafflePaidOut(id);

        emit BatchPayoutProcessed(msg.sender, id, _sum(amounts));
        // Community updates its own raffle status to PaidOut once all claimed via recordClaim path.
        // Alternatively, PaidOut can be set after this by Community if desired.
    }

    // Helpers
    function _sum(uint256[] memory arr) internal pure returns (uint256 s) {
        for (uint256 i = 0; i < arr.length; i++) {
            s += arr[i];
        }
    }
}

contracts/TimelockVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {SafeERC20} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import {ICommunity} from "./interfaces/ICommunity.sol";

/**
 * @title TimelockVault
 * @notice Community-level multi-token vault that locks funds per raffleId and releases only after timelock.
 *         Factory orchestrates payouts; Community performs funding and locking.
 */
contract TimelockVault {
    using SafeERC20 for IERC20;

    address public immutable community;
    address public immutable factory;

    // token => total reserved (locked but not yet paid)
    mapping(address => uint256) public reservedTotal;

    struct Lock {
        uint256 amount;
        uint64 endTime;
        bool locked;
        bool disbursed;
        uint256 paid;
    }

    // raffleId => token => lock
    mapping(uint256 => mapping(address => Lock)) public locks;

    event Locked(
        uint256 indexed raffleId,
        address indexed token,
        uint256 amount,
        uint64 endTime
    );
    event Paid(
        uint256 indexed raffleId,
        address indexed token,
        address indexed to,
        uint256 amount
    );
    event BatchPaid(
        uint256 indexed raffleId,
        address indexed token,
        uint256 totalPaid
    );
    event Disbursed(uint256 indexed raffleId, address indexed token);
    event Unlocked(
        uint256 indexed raffleId,
        address indexed token,
        uint256 amount
    );
    event Withdrawn(address indexed token, address indexed to, uint256 amount);

    modifier onlyCommunity() {
        require(msg.sender == community, "ONLY_COMMUNITY");
        _;
    }

    modifier onlyFactory() {
        require(msg.sender == factory, "ONLY_FACTORY");
        _;
    }

    constructor(address _community, address _factory) {
        require(_community != address(0), "INVALID_COMMUNITY");
        require(_factory != address(0), "INVALID_FACTORY");
        community = _community;
        factory = _factory;
    }

    receive() external payable {}

    // Lock funds for a raffle
    function lockFunds(
        uint256 raffleId,
        address token,
        uint256 amount,
        uint64 endTime
    ) external onlyCommunity {
        require(endTime > block.timestamp, "ENDTIME_IN_PAST");
        require(amount > 0, "ZERO_AMOUNT");
        Lock storage L = locks[raffleId][token];
        require(!L.locked, "ALREADY_LOCKED");
        // ensure sufficient available (balance - reserved)
        uint256 currentBalance = getBalance(token);
        uint256 available = currentBalance - reservedTotal[token];
        require(available >= amount, "INSUFFICIENT_AVAILABLE");
        L.amount = amount;
        L.endTime = endTime;
        L.locked = true;
        reservedTotal[token] += amount;
        emit Locked(raffleId, token, amount, endTime);
    }

    function unlockFunds(
        uint256 raffleId,
        address token
    ) external onlyCommunity {
        Lock storage L = locks[raffleId][token];
        require(L.locked, "NOT_LOCKED");
        require(!L.disbursed, "ALREADY_DISBURSED");

        uint256 amount = L.amount;
        reservedTotal[token] -= amount;

        delete locks[raffleId][token];

        emit Unlocked(raffleId, token, amount);
    }

    function sendFee(
        address token,
        address to,
        uint256 amount
    ) external onlyCommunity {
        require(amount > 0, "ZERO_AMOUNT");
        uint256 available = getBalance(token) - reservedTotal[token];
        require(available >= amount, "INSUFFICIENT_FOR_FEE");

        if (token == address(0)) {
            (bool success, ) = payable(to).call{value: amount}("");
            require(success, "ETH_TRANSFER_FAILED");
        } else {
            IERC20(token).safeTransfer(to, amount);
        }
    }

    function withdrawAvailable(
        address token,
        address to,
        uint256 amount
    ) external onlyCommunity {
        require(amount > 0, "ZERO_AMOUNT");
        uint256 available = getBalance(token) - reservedTotal[token];
        require(available >= amount, "INSUFFICIENT_AVAILABLE");

        if (token == address(0)) {
            (bool success, ) = payable(to).call{value: amount}("");
            require(success, "ETH_TRANSFER_FAILED");
        } else {
            IERC20(token).safeTransfer(to, amount);
        }

        emit Withdrawn(token, to, amount);
    }

    function canDisburse(
        uint256 raffleId,
        address token
    ) public view returns (bool) {
        Lock storage L = locks[raffleId][token];
        if (!L.locked || L.disbursed) return false;

        // Get raffle details from community
        (
            ,
            uint64 endTime,
            ,
            uint32 maxParticipants,
            ,
            ,
            ,
            uint256 participantsCount
        ) = ICommunity(community).getRaffleCore(raffleId);

        // Can disburse if time ended OR max participants reached
        bool timeEnded = block.timestamp >= endTime;
        bool maxReached = maxParticipants > 0 &&
            participantsCount >= maxParticipants;

        return timeEnded || maxReached;
    }

    // Factory-triggered payouts
    function batchPay(
        uint256 raffleId,
        address token,
        address[] calldata tos,
        uint256[] calldata amounts
    ) external onlyFactory {
        require(tos.length == amounts.length, "LEN_MISMATCH");
        require(canDisburse(raffleId, token), "TIMELOCK_ACTIVE");
        Lock storage L = locks[raffleId][token];
        uint256 total;
        for (uint256 i = 0; i < tos.length; i++) {
            address to = tos[i];
            uint256 amount = amounts[i];
            require(to != address(0), "INVALID_TO");
            require(amount > 0, "ZERO_AMOUNT");
            require(L.paid + amount <= L.amount, "OVERPAY");
            if (token == address(0)) {
                (bool success, ) = payable(to).call{value: amount}("");
                require(success, "ETH_TRANSFER_FAILED");
            } else {
                IERC20(token).safeTransfer(to, amount);
            }
            L.paid += amount;
            reservedTotal[token] -= amount;
            total += amount;
            emit Paid(raffleId, token, to, amount);
        }
        emit BatchPaid(raffleId, token, total);

        if (L.paid == L.amount) {
            L.disbursed = true;
            emit Disbursed(raffleId, token);
        }
    }

    // Views
    function getBalance(address token) public view returns (uint256) {
        if (token == address(0)) {
            return address(this).balance;
        }
        return IERC20(token).balanceOf(address(this));
    }

    function getAvailable(address token) external view returns (uint256) {
        return getBalance(token) - reservedTotal[token];
    }
}

